import "./App.css";
import React, { useState } from "react";

function App() {
  const [markdown, setMarkdown] = useState("#sup");
  return (
    <div className="displayFlex">
      <textarea
        value={markdown}
        onChange={(e) => setMarkdown(e.target.value)}
      ></textarea>
      <div>{markdown}</div>
    </div>
  );
}

export default App;
